export class StrangeNewWorldsUniformPack extends BaseNeckProvider implements IUniformPack {

    getUniformSwatches() {
        return [
            new Swatch(BodyType.AverageMale, "Average Male", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.StrangeNewWorlds) + StrangeNewWorldsUniforms.averageMaleBody, BodyType.AverageMale, token), "BodyType.averageMale"),
            new Swatch(BodyType.AverageFemale, "Average Female", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.StrangeNewWorlds) + StrangeNewWorldsUniforms.averageFemaleBody, BodyType.AverageFemale, token), "BodyType.averageFemale"),
        ];
    }

    getUniformAndVariantBody(token: Token) {
        let division = DivisionColors.getDivision(token.uniformEra, token.divisionColor);
        let result = "";
        switch (token.bodyType) {
            case BodyType.AverageMale: {
                result = StrangeNewWorldsUniforms.averageMaleBody;
                if (division === Division[Division.Command]) {
                    result += OriginalSeriesMaleBodyCommandSymbol;
                } else if (division === Division[Division.Science]) {
                    result += OriginalSeriesMaleBodyScienceSymbol;
                } else if (division === Division[Division.Operations]) {
                    result += OriginalSeriesMaleBodyEngineeringSymbol;
                }
                break;
            }
            case BodyType.AverageFemale:
                result = StrangeNewWorldsUniforms.averageFemaleBody;
                if (division === Division[Division.Command]) {
                    result += StrangeNewWorldsUniforms.deltaSymbolFemale.command;
                } else if (division === "Science" || division === "Medical" || division === "Nursing") {
                    result += StrangeNewWorldsUniforms.deltaSymbolFemale.science;
                } else if (division === Division[Division.Operations]) {
                    result += StrangeNewWorldsUniforms.deltaSymbolFemale.operations;
                }
                break;
            default:
        }

        return this.getNeck(token.bodyType, token.skinColor, token.species, UniformEra.OriginalSeries)
            + result.replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
    }

    getUniformVariantSwatches(token: Token) {
        return [];
    }

    getRankSwatches() {
        return [
            new Swatch(Rank.None, "None", (token) => StrangeNewWorldsUniformPack.decorateRankSwatch("", Rank.None, token), "Rank.none.name"),
            new Swatch(Rank.Ensign, "Ensign", (token) => StrangeNewWorldsUniformPack.decorateRankSwatch(TosEnsign, Rank.Ensign, token), "Rank.ensign.name"),
            new Swatch(Rank.LieutenantJG, "Lieutenant J.G.", (token) => StrangeNewWorldsUniformPack.decorateRankSwatch(TosLieutenantJG, Rank.LieutenantJG, token), "Rank.lieutenantJG.name"),
            new Swatch(Rank.Lieutenant, "Lieutenant", (token) => StrangeNewWorldsUniformPack.decorateRankSwatch(TosLieutenant, Rank.Lieutenant, token), "Rank.lieutenant.name"),
            new Swatch(Rank.LtCommander, "Lt. Commander", (token) => StrangeNewWorldsUniformPack.decorateRankSwatch(TosLtCommander, Rank.LtCommander, token), "Rank.ltCommander.name"),
            new Swatch(Rank.Commander, "Commander", (token) => StrangeNewWorldsUniformPack.decorateRankSwatch(TosCommander, Rank.Commander, token), "Rank.commander.name"),
            new Swatch(Rank.Captain, "Captain", (token) => StrangeNewWorldsUniformPack.decorateRankSwatch(TosCaptain, Rank.Captain, token), "Rank.captain.name")
        ];
    }

    getRankIndicator(token: Token) {
        return "";
    }

    getRankBorderIndicator(token: Token) {
        switch (token.rankIndicator) {
            case Rank.Ensign:
                return TosEnsignRankBorder.replace(DefaultRed, token.divisionColor);
            case Rank.LieutenantJG:
                return TosLieutenantJGBorder.replace(DefaultRed, token.divisionColor);
            case Rank.Lieutenant:
                return TosLieutenantBorder.replace(DefaultRed, token.divisionColor);
            case Rank.LtCommander:
                return TosLtCommanderBorder.replace(DefaultRed, token.divisionColor);
            case Rank.Commander:
                return TosCommanderBorder.replace(DefaultRed, token.divisionColor);
            case Rank.Captain:
                return TosCaptainBorder.replace(DefaultRed, token.divisionColor);
            default:
                return "";
        }
    }

    getBorderColor(token: Token) {
        if (token.variant === UniformVariantType.Variant1 && DivisionColors.getDivision(UniformEra.OriginalSeries, token.divisionColor) === "Command"
                && token.rankIndicator === Rank.Captain) {
            return "#88966c";
        } else {
            return token.divisionColor;
        }
    }


    getRankBorderDefinitions(token: Token, bordered: boolean) {
        return "";
    }

    static decorateRankSwatch(svg: string, rankIndicator: Rank, token: Token) {
        return `<svg viewBox="0 0 80 80" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
            <defs>
                <clipPath id="rankClipPath` + rankIndicator + `">
                    <circle cx="40" cy="40" r="40" fill="#ffffff" />
                </clipPath>
            </defs>
            <g clip-path="url(#rankClipPath` + rankIndicator + `">
                <g transform="translate(-65, -318)">`
        + svg.replace(DefaultRed, token.divisionColor)
        + `</g>
        + </g>
        </svg>`;
    }

    getBorderLogo(token: Token): string {
        let division = DivisionColors.getDivision(token.uniformEra, token.divisionColor);
        if (division === Division[Division.Command]) {
            return TosCommandDelta;
        } else if (division === Division[Division.Operations]) {
            return TosEngineeringDelta;
        } else {
            return TosScienceDelta;
        }
    }

    isDivisionColorSupported(token: Token): boolean {
        return true;
    }
}

